import React from "react";
import { NavLink } from "react-router-dom";

const Menu = () => {
  return (
    <>
    <div>
      <NavLink exact activeClassName="active_class" to="/">
        AboutUs
      </NavLink>
      <NavLink exact activeClassName="active_class" to="/contact">
        ContactUs
      </NavLink></div>
    </>
  );
};

export default Menu;
